(7609, 900, 'content', '<p class=\"x_x_MsoNormal\"><span data-olk-copy-source=\"MessageBody\">Features:</span></p>\r\n\r\n<ol start=\"1\" type=\"1\" data-listchain=\"__List_Chain_55\">\r\n 	<li class=\"x_x_MsoListParagraph\">Voltage Rating: 1500V (1.5kV) DC</li>\r\n 	<li class=\"x_x_MsoListParagraph\">Conductor: Circular tinned copper (Cu Flexible-Class 5)</li>\r\n 	<li class=\"x_x_MsoListParagraph\">Insulation – LSZH (Low Smoke Zero Halogen)</li>\r\n 	<li class=\"x_x_MsoListParagraph\">Nominal Insulation Thickness: 0.7mm</li>\r\n 	<li class=\"x_x_MsoListParagraph\">Approx. overall diameter- 5.0~9.0mm</li>\r\n 	<li class=\"x_x_MsoListParagraph\">Sheathing – LSZH (Low Smoke Zero Halogen)</li>\r\n 	<li class=\"x_x_MsoListParagraph\">Standards Compliance: IEC 60228, BS EN 50618, IEC 60754, IEC 61034 , IEC 60332-1</li>\r\n</ol>'),
