(92, 1, '2022-11-12 04:38:53', '2022-11-12 04:38:53', '<strong>20KW | 25KW | 30KW</strong>\r\nSolaX have developed a range of three phase inverters unrivalled in the industry for their quality, reliability and efficiency. The SolaX three phase 20-30KW inverters boast an ultra wide MPPT voltage range to allow for more energy harvesting and have a maximum input voltage of 1000V, with a maximum efficiency of 98.2%. In addition, SolaX three phase inverters are IP65 rated, have no internal fan and come with optional ‘plug &amp; play’ WIFI. (Not available in the UK)', 'SOLAX X3 MAX- THREE PHASE STRING INVERTER', '', 'draft', 'closed', 'closed', '', 'solax-x3-max-three-phase-string-inverter', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=92', 125, 'product', '', 0),
