(94, 1, '2022-11-12 04:40:01', '2022-11-12 04:40:01', '<strong>X3-MEGA : 50KW | 60KW</strong>\r\n<strong>X3-MEGA G2 : 40KW | 50KW | 60KW</strong>\r\nSolaX have developed a range of three phase inverters unrivalled in the industry for their quality, reliability and efficiency. The SolaX three phase 40-60KW inverters boast an ultra wide MPPT voltage range to allow for more energy harvesting and have a maximum input voltage of 1100V, with a maximum efficiency of 98.4%. In addition, SolaX three phase inverters are IP66 rated, have no internal fan and come with optional ‘plug &amp; play’ WIFI.', 'SOLAX X3 MEGA - THREE PHASE STRING INVERTER', '', 'draft', 'closed', 'closed', '', 'solax-x3-mega-three-phase-string-inverter', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=94', 124, 'product', '', 0),
