(96, 1, '2022-11-12 04:47:56', '2022-11-12 04:47:56', '<strong>80KW / 100KW / 110KW / 120KW / 125KW / 136KW / 150KW</strong>\r\n\r\nSolaX have developed the commercial and roof-top scale string inverter with quality, reliability and efficiency. SolaX three phase 80-150KW inverters boast an ultra-wide MPPT voltage range to allow for more energy harvesting and have a maximum input voltage of 1100V, with a maximum MPPT efficiency of 99.9%. In addition, SolaX X3-Forth is IP66 rated, featured with 32A MPPT current and 150% oversized PV input, customized power station with up to 9MW, 60 parallel system can be achieved by SolaX Datahub 1000.', 'SOLAX X3 FORTH - THREE PHASE STRING INVERTER', '', 'draft', 'closed', 'closed', '', 'solax-x3-forth-three-phase-string-inverter', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=96', 123, 'product', '', 0),
