(99, 1, '2022-11-12 04:57:08', '2022-11-12 04:57:08', '<strong>X1 Hybrid G4: 3.0KW | 3.7KW | 5.0KW | 6.0KW | 7.5KW</strong>\r\n<strong>X3 Hybrid G4: 5.0KW | 6.0KW | 8.0KW | 10.0KW | 12.0KW | 15.0KW</strong>\r\n<strong>T-BAT-SYS-HV-3.0 : 3.0KWH | 6.0KWH | 9.0KWH | 12.0KWH</strong>\r\n<strong>T-BAT-SYS-HV-5.8 : 5.8KWH | 11.5KWH | 17.3KWH | 23KWH</strong>\r\nSolaX Power is delighted to announce the launch of the eagerly anticipated fourth generation of our market-leading solar battery storage product Hybrid inverter, which now includes an all in one system X-ESS. Combining our 4th generation X1/X3-Hybrid inverter and our latest Triple Power 3.0kWh/5.8kWh battery, SolaX have designed and developed the future of residential energy storage. The X-ESS is available in both three phase and single phase models.', 'X-ESS G4- HIGH VOLTAGE ALL IN ONE STORAGE SYSTEM', '', 'draft', 'closed', 'closed', '', 'x-ess-g4-high-voltage-all-in-one-storage-system', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=99', 122, 'product', '', 0),
