(101, 1, '2022-11-12 04:58:46', '2022-11-12 04:58:46', '<strong>3.0KW | 3.7KW | 4.6KW | 5.0KW</strong>\r\nSolaX Power is delighted to announce the launch of the eagerly anticipated third generation of our market-leading solar battery storage  product Hybrid inverter, which now includes a range of both single-phase and three-phase models. The X-Hybrid battery storage inverter is compatible with the leading lithium-ion battery solutions available on the market today making it the most popular energy storage solution.', 'SOLAX SINGLE PHASE HYBRID - HIGH VOLTAGE', '', 'draft', 'closed', 'closed', '', 'solax-single-phase-hybrid-high-voltage', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=101', 121, 'product', '', 0),
