(103, 1, '2022-11-12 05:04:24', '2022-11-12 05:04:24', '<div class=\"gdlr-core-pbf-element\">\r\n<div class=\"gdlr-core-title-item gdlr-core-item-pdb clearfix  gdlr-core-center-align gdlr-core-title-item-caption-top gdlr-core-item-pdlr\"><strong><span class=\"gdlr-core-title-item-caption gdlr-core-info-font gdlr-core-skin-caption\">5.0KW | 6.0KW | 8.0KW | 10.0KW</span></strong></div>\r\n</div>\r\n<div class=\"gdlr-core-pbf-element\">\r\n<div class=\"gdlr-core-text-box-item gdlr-core-item-pdlr gdlr-core-item-pdb gdlr-core-left-align\">\r\n<div class=\"gdlr-core-text-box-item-content\">\r\n\r\nSolaX Power is pleased to announce the launch of the X-Hybrid Three Phase commercial battery storage inverter. The 3-Phase includes inverters ranging in size from 5 to 10kW, and with the ability to install multiple inverters in parallel, scalable battery storage for commercial applications is now a reality. The inverter is equipped with EPS (Emergency Power Supply) function only when supported by extra changeover devices, has multiple communication options and can be controlled remotely.\r\n\r\n</div>\r\n</div>\r\n</div>', 'SOLAX THREE PHASE HYRBID - HIGH VOLTAGE', '', 'draft', 'closed', 'closed', '', 'solax-three-phase-hyrbid-high-voltage', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=103', 120, 'product', '', 0),
