(105, 1, '2022-11-12 05:05:27', '2022-11-12 05:05:27', '<strong>3.0KW | 3.6KW</strong>\r\nSolaX Power is delighted to announce the release of our new AC Charger. Generate energy from your solar panels during the day, once the background load is satisfied, the intelligent SolaX AC charger will direct excess energy into your battery for later use. Enabling you to make the most use of your generated energy. Compatible with every inverter manufacturer, the AC charger is the perfect upgrade to your system.', 'SOLAX SINGLE PHASE AC CHARGER - HIGH VOLTAGE', '', 'draft', 'closed', 'closed', '', 'solax-single-phase-ac-charger-high-voltage', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=105', 119, 'product', '', 0),
