(107, 1, '2022-11-12 05:07:25', '2022-11-12 05:07:25', '<strong>3.7KW | 5.0KW | 6.0KW | 7.5KW</strong>\r\nSolaX Power is delighted to announce the release of our new X1 Retro Fit Charger. Generate energy from your solar panels during the day, once the background load is satisfied, the intelligent SolaX X1 Retro Fit will direct excess energy into your battery for later use. Enabling you to make the most use of your generated energy. If your home experiences a loss of power, the X1 Retro Fit will then send the stored power back to the home, ensuring you are never left in the dark even during a power-cut. Compatible with every inverter manufacturer, the X1 Retro Fit charger is the perfect upgrade to your system.', 'SOLAX SINGLE PHASE X1 RETRO FIT CHARGER - HIGH VOLTAGE', '', 'draft', 'closed', 'closed', '', 'solax-single-phase-x1-retro-fit-charger-high-voltage', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=107', 118, 'product', '', 0),
