(110, 1, '2022-11-12 05:13:55', '2022-11-12 05:13:55', '<strong>6.0KW | 8.0KW | 10.0KW | 15.0KW</strong>\r\nSolaX Power is delighted to announce the release of our new X3 Retro Fit Charger. Generate energy from your solar panels during the day, once the background load is satisfied, the intelligent SolaX X3 Retro Fit will direct excess energy into your battery for later use. Enabling you to make the most use of your generated energy. If your home experiences a loss of power, the X3 Retro Fit will then send the stored power back to the home, ensuring you are never left in the dark even during a power-cut.', 'SOLAX THREE PHASE X3 RETRO FIT CHARGER - HIGH VOLTAGE', '', 'draft', 'closed', 'closed', '', 'solax-three-phase-x3-retro-fit-charger-high-voltage', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=110', 117, 'product', '', 0),
