(112, 1, '2022-11-12 05:23:30', '2022-11-12 05:23:30', '<strong>J1ESS-HB58 | J1ESS-HB115 173</strong>\r\nSolaX Power is delighted to announce the release of our new all in one residential storage solution. Generate energy from your solar panels during the day, once the background load is satisfied, the intelligent battery management system will direct excess energy into your battery for later use. Enabling you to make the most use of your generated energy.', 'SOLAX ALL IN ONE RESIDENTIAL STORAGE SOLUTION', '', 'draft', 'closed', 'closed', '', 'solax-all-in-one-residential-storage-solution', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=112', 116, 'product', '', 0),
