(114, 1, '2022-11-12 05:32:25', '2022-11-12 05:32:25', '<strong>POWER THE ENTIRE HOME</strong>\r\nWhen outage or extreme weather comes, A1-ESS G2 is able to power all your home appliances easily and efficiently to enable seamless work and entertainment experience. Simply install 1 system, smartly power whole home.', 'A1-ESS G2 Load Management System', '', 'draft', 'closed', 'closed', '', 'a1-ess-g2-load-management-system', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=114', 115, 'product', '', 0),
