(117, 1, '2022-11-12 05:46:04', '2022-11-12 05:46:04', '<strong>3.0/5.8kWh</strong>\r\nSolaX Power is delighted to announce compatibility with the new Triple Power high-voltage battery solution. Designed and manufactured by SolaX, Triple Power is offering a NEW 5.8kWh model that can be installed in series with up to 4 batteries enabling 23kWh of storage. The new Triple Power encompasses the very latest in LFP technology which ensures much safer installations with wider temperature tolerances. With a 10-year warranty and 90% depth of discharge, the new Triple Power battery is a flexible, practical, high-performance energy storage solution.', 'SOLAX TRIPLE POWER BATTERY - LFP', '', 'draft', 'closed', 'closed', '', 'solax-triple-power-battery-lfp', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=117', 114, 'product', '', 0),
