(119, 1, '2022-11-12 05:47:13', '2022-11-12 05:47:13', '<strong>X1-EVC-7.2K | X3-EVC-11K | X3-EVC-22K</strong>\r\nSolaX Power is delighted to announce the release of our new EV Charger, charge your electric vehicle at home from your solar with the SolaX smart home wall box. The smart home wall box enables customers to really maximise the use of generated solar in the home if they have an electric vehicle.', 'SMART EV CHARGER', '', 'draft', 'closed', 'closed', '', 'smart-ev-charger', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=119', 113, 'product', '', 0),
