(121, 1, '2022-11-12 05:48:14', '2022-11-12 05:48:14', '<strong>Pocket WiFi | Pocket LAN</strong>\r\nSolaX Power offer remote monitoring for all of our products via the SolaX Cloud, an intelligent, multifunctional monitoring platform that can be accessed either remotely or through a hard wired connection. Whether it’s for residential systems or commercial PV systems, centralised  management and monitoring of PV systems saves time and money. With the SolaX Cloud, PV system operators and installers can always view key and up to date data.', 'SOLAX REMOTE MONITORING DONGLES', '', 'draft', 'closed', 'closed', '', 'solax-remote-monitoring-dongles', '', '', '2024-12-27 06:20:23', '2024-12-27 06:20:23', '', 0, 'http://shajarass.com/?post_type=product&#038;p=121', 112, 'product', '', 0),
