(287, 1, '2023-01-17 06:34:09', '2023-01-17 06:34:09', '<!-- wp:paragraph -->\r\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:quote -->\r\n<blockquote class=\"wp-block-quote\">\r\n<p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</p>\r\n</blockquote>\r\n<!-- /wp:quote -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>...or something like this:</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:quote -->\r\n<blockquote class=\"wp-block-quote\">\r\n<p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p>\r\n</blockquote>\r\n<!-- /wp:quote -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>As a new WordPress user, you should go to <a href=\"http://shajarass.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\r\n<!-- /wp:paragraph -->', 'Home', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2023-01-17 06:34:09', '2023-01-17 06:34:09', '', 2, 'http://shajarass.com/?p=287', 0, 'revision', '', 0),
(288, 1, '2023-01-21 13:15:45', '2023-01-21 13:15:45', '<!-- wp:paragraph -->\r\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\r\n<!-- /wp:paragraph -->', 'Hello world!', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2023-01-21 13:15:45', '2023-01-21 13:15:45', '', 1, 'http://shajarass.com/?p=288', 0, 'revision', '', 0),
(289, 1, '2023-01-21 13:16:49', '2023-01-21 13:16:49', '<p>The World Future Energy Summit is the leading international event accelerating sustainability and the global transition to clean energy.</p>\n<p>Exhibition, technology showcase, investment incubator and business forum all rolled into one event, the summit convenes leaders, innovators and global thinkers to share ideas that are creating the blueprints for a sustainable future.</p>\n[ngg src=\"galleries\" ids=\"2\" display=\"basic_thumbnail\" thumbnail_crop=\"0\"]', 'The World Future Energy Summit is the leading international event accelerating sustainability and the global transition to clean energy.', '', 'inherit', 'closed', 'closed', '', '1-autosave-v1', '', '', '2023-01-21 13:16:49', '2023-01-21 13:16:49', '', 1, 'http://shajarass.com/?p=289', 0, 'revision', '', 0),
(290, 1, '2023-01-21 13:16:57', '2023-01-21 13:16:57', '<p>The World Future Energy Summit is the leading international event accelerating sustainability and the global transition to clean energy.</p>\r\n<p>Exhibition, technology showcase, investment incubator and business forum all rolled into one event, the summit convenes leaders, innovators and global thinkers to share ideas that are creating the blueprints for a sustainable future.</p>\r\n[ngg src=\"galleries\" ids=\"2\" display=\"basic_thumbnail\" thumbnail_crop=\"0\"]', 'The World Future Energy Summit is the leading international event accelerating sustainability and the global transition to clean energy.', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2023-01-21 13:16:57', '2023-01-21 13:16:57', '', 1, 'http://shajarass.com/?p=290', 0, 'revision', '', 0),
(291, 1, '2023-01-21 13:22:56', '2023-01-21 13:22:56', '<p dir=\"ltr\"><img class=\"aligncenter wp-image-294 size-full\" src=\"http://shajarass.com/wp-content/uploads/2023/01/WhatsApp-Image-2023-01-16-at-4.18.32-PM-1.jpeg\" alt=\"\" width=\"1375\" height=\"745\" /></p>\r\n<p dir=\"ltr\">Kuwait is moving towards implementing a Feed-in Tariff system, which defines a fixed rate for purchasing energy from renewable sources (in kilowatt hour), different from the conventional electricity tariff applied by distribution companies. This system guarantees customers the purchase of electricity from renewable energy systems through a long-term power purchase agreement that can last up to 25 years.</p>\r\n<p dir=\"ltr\">In conjunction with the launch of this system, Kuwaiti company Shajara for Sustainability Solutions – which specializes in developing renewable energy solutions and products  as well as providing related consulting services – has signed an agreement with German company Kaco Semeiens to be its supplier of inverters  in several countries including Oman, Saudi Arabia, Egypt and Kuwait.</p>', 'Launching a Feed-in Tariff system, and Shajara signs an important supply agreement', '', 'publish', 'open', 'open', '', 'kuwait-launching-a-feed-in-tariff-system-and-shajara-signs-an-important-supply-agreement', '', '', '2023-01-22 08:34:23', '2023-01-22 08:34:23', '', 0, 'http://shajarass.com/?p=291', 0, 'post', '', 0),
(292, 1, '2023-01-21 13:22:56', '2023-01-21 13:22:56', '<p dir=\"ltr\">Kuwait is moving towards implementing a Feed-in Tariff system, which defines a fixed rate for purchasing energy from renewable sources (in kilowatt hour), different from the conventional electricity tariff applied by distribution companies. This system guarantees customers the purchase of electricity from renewable energy systems through a long-term power purchase agreement that can last up to 25 years.</p>\r\n<p dir=\"ltr\">In conjunction with the launch of this system, Kuwaiti company Shajara for Sustainability Solutions – which specializes in developing renewable energy solutions and products&nbsp; as well as providing related consulting services – has signed an agreement with German company Kaco Semeiens to be its supplier of inverters&nbsp; in several countries including Oman, Saudi Arabia, Egypt and Kuwait.</p>', 'Kuwait: Launching a Feed-in Tariff system, and Shajara signs an important supply agreement', '', 'inherit', 'closed', 'closed', '', '291-revision-v1', '', '', '2023-01-21 13:22:56', '2023-01-21 13:22:56', '', 291, 'http://shajarass.com/?p=292', 0, 'revision', '', 0),
