(295, 1, '2023-01-21 13:44:39', '2023-01-21 13:44:39', '<p dir=\"ltr\"><img class=\"aligncenter wp-image-294 size-full\" src=\"http://shajarass.com/wp-content/uploads/2023/01/WhatsApp-Image-2023-01-16-at-4.18.32-PM-1.jpeg\" alt=\"\" width=\"1375\" height=\"745\"></p>\r\n<p dir=\"ltr\">Kuwait is moving towards implementing a Feed-in Tariff system, which defines a fixed rate for purchasing energy from renewable sources (in kilowatt hour), different from the conventional electricity tariff applied by distribution companies. This system guarantees customers the purchase of electricity from renewable energy systems through a long-term power purchase agreement that can last up to 25 years.</p>\r\n<p dir=\"ltr\">In conjunction with the launch of this system, Kuwaiti company Shajara for Sustainability Solutions – which specializes in developing renewable energy solutions and products&nbsp; as well as providing related consulting services – has signed an agreement with German company Kaco Semeiens to be its supplier of inverters&nbsp; in several countries including Oman, Saudi Arabia, Egypt and Kuwait.</p>', 'Kuwait: Launching a Feed-in Tariff system, and Shajara signs an important supply agreement', '', 'inherit', 'closed', 'closed', '', '291-revision-v1', '', '', '2023-01-21 13:44:39', '2023-01-21 13:44:39', '', 291, 'http://shajarass.com/?p=295', 0, 'revision', '', 0),
