(381, 3, '2024-07-04 14:19:31', '2024-07-04 14:19:31', '<div class=\"form-contact\">\r\n                        <div class=\"row g-3\">\r\n                            <div class=\"col-md-6\">\r\n                                <div class=\"form-floating\">[text* your-name class:form-control placeholder \"Your Name\"] \r\n                                </div>\r\n                            </div>\r\n                            <div class=\"col-md-6\">\r\n                                <div class=\"form-floating\">[email* your-email class:form-control placeholder \"Your E-mail\"] \r\n                                </div>\r\n                            </div>\r\n                            <div class=\"col-12\">\r\n                                <div class=\"form-floating\">\r\n                                    [text* your-subject class:form-control placeholder \"Subject \"] \r\n                                </div>\r\n                            </div>\r\n                            <div class=\"col-12\">\r\n                                <div class=\"form-floating\">[textarea your-message class:form-control placeholder \"Message\"] \r\n                                </div>\r\n                            </div>\r\n<div class=\"row\">\r\n<div class=\"col-md-12\"><label>Enter captcha code</label>[captchac captcha-1] [captchar captcha-1]</div> \r\n</div> \r\n                            <div class=\"col-12\">[submit \"Submit\" class:btn class:btn-primary class:w-100 class:py-3]</div>\r\n                        </div>\r\n                    </div>\n1\n[_site_title] \"[your-subject]\"\nShajara Sustainability Solutions (3S) <no-reply@shajarass.com>\ninfo@alshajara.com\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\n\n\n\n\n1\nThank you for your inquiry.\nShajara Sustainability Solutions (3S) <no-reply@shajarass.com>\n[your-email]\nHi [your-name],\r\n\r\nThank you for reaching out. We’ve received your inquiry and will get back to you as quickly as possible.\r\n\r\n\r\n<a href=\"http://shajarass.com\" target=\"_blank\">\r\n              <img  style=\"width:200px;\"src=\"http://shajarass.com/wp-content/themes/shajara/img/3S-logo.jpg\">\r\n        </a>\r\n<b>Shajara Sustainability Solutions (3S)</b>\r\n11th floor, Albudor Altejaria Tower,\r\nAhmad Al Jaber St, Kuwait City 13031\r\n<br>\r\n<a  href=\"https://www.linkedin.com/company/shajara-sustainable-solutions-3s/\" target=\"_blank\"><img   style=\"width:150px;\" src=\"http://shajarass.com/wp-content/themes/shajara/img/linkedin-contact.png\"></a>\r\n<a href=\"http://shajarass.com\" target=\"_blank\">www.shajarass.com</a>\r\n<a href=\"mailto:Hashem@alshajara.com\"  >Hashem@alshajara.com</a>\r\nTel: <a href=\"tel:+965 66111864\" >+965 66111864</a>\n\n\n1\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nPlease fill out this field.\nThis field has a too long input.\nThis field has a too short input.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe uploaded file is too large.\nThere was an error uploading the file.\nPlease enter a date in YYYY-MM-DD format.\nThis field has a too early date.\nThis field has a too late date.\nPlease enter a number.\nThis field has a too small number.\nThis field has a too large number.\nThe answer to the quiz is incorrect.\nPlease enter an email address.\nPlease enter a URL.\nPlease enter a telephone number.', 'Contact form', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2024-11-18 05:48:09', '2024-11-18 05:48:09', '', 0, 'http://shajarass.com/?post_type=wpcf7_contact