(8, 5, '_image', 'field_636ed8611375b'),
(9, 5, 'about', '<h2>For all</h2>\r\nIn 1999, KACO new energy revolutionised the market with the first series-ready string inverter without transformer. To this day, our string inverters are manufactured in Germany, but have long since captured worldwide markets. They are equipped for a wide variety of applications in PV plants of all sizes - from single-family homes to decentralised multi-megawatt solar parks.'),
(10, 5, '_about', 'field_636edb2c6f159'),
(11, 6, 'image', '21'),
(12, 6, '_image', 'field_636ed8611375b'),
(13, 6, 'about', '<h2>Come to terms with energy</h2>\r\nSometimes true treasures lie stored and hidden in the attic. Before wasting time in search for them, why not make the decision for an energy storage system now? Storing electricity and using it for self-consumption makes your energy supply more efficient and independent and offers financial advantages – in your own home as well as in businesses.'),
(14, 6, '_about', 'field_636edb2c6f159'),
(15, 7, 'image', '22'),
(16, 7, '_image', 'field_636ed8611375b'),
(17, 7, 'about', '<h2>Increase energy efficiency</h2>\r\nAnyone who is familiar with the subject of reactive power compensation will witness a technical revolution here: There is no other solution for optimising reactive power that is as simple and compact as our reactive power compensation unit.'),
(18, 7, '_about', 'field_636edb2c6f159'),
(19, 8, 'image', '23'),
(20, 8, '_image', 'field_636ed8611375b'),
(21, 8, 'about', '<h2>Trust is good, control is better.</h2>\r\nYour investment in photovoltaics only pays for itself with continuous solar yields. Together with our partner meteocontrol, we offer you two monitoring portals that leave nothing to be desired.\r\n\r\nData loggers, such as the exemplary blue\'Log X below, perform not only data recording but also control tasks in PV systems. You can obtain devices from well-known suppliers from KACO new energy together with our inverters from a single source. Talk to us!'),
(22, 8, '_about', 'field_636edb2c6f159'),
(23, 9, 'image', '24'),
(24, 9, '_image', 'field_636ed8611375b'),
(25, 9, 'about', '<h2>Ready for anything</h2>\r\nDon\'t worry about grid management, power control, etc.: With the right equipment, extended technical requirements for solar PV systems can be easily implemented. Our current range includes the following accessories:'),
(26, 9, '_about', 'field_636edb2c6f159'),
